/**
 * Object containing metadata about a CLI package or plugin
 * @export
 * @interface IWebHelpPackageMetadata
 */
export interface IWebHelpPackageMetadata {
    /**
     * Name of package
     * @type {string}
     * @memberof IWebHelpPackageMetadata
     */
    name: string;
    /**
     * Version string of package
     * @type {string}
     * @memberof IWebHelpPackageMetadata
     */
    version: string;
}
